column8:
Afdeling: Verblijfsgebied en verblijfsruimte

Conform Bouwbesluit niveau nieuwbouw.
Toepassing niveau verbouw is niet toegestaan.
Hoogte woon- en slaapkamer: tenminste 2,4 meter, bij voorkeur 2,6 meter;
Hoogte (gemeenschappelijke) verkeersruimten: tenminste 2,1 meter, bij voorkeur 2,4 meter;
Hoogte hallen en corridors: 2,6 meter.
